import axios from "axios";
import React, { useContext } from "react";
import { useEffect } from "react";
import { useState } from "react";
import Header from "../components/Header";
import { AuthContext } from "../context/authContext";

const Allcar = () => {
  const { currentUser } = useContext(AuthContext);
  const [car, setCars] = useState([]);

  useEffect(() => {
    const fetchdata = async () => {
      try {
        const res = await axios.get(
          `http://10.0.1.205:8800/api/cars/getcar/${currentUser.id}`
          
        );
      } catch (err) {}
    };
  });
  return (
    <div>
      <Header />
      <div class="container" style={{ marginTop: "50px" }}>
        <div class="row">
          <div class="col-md-3">
            <div class="card-sl">
              <div class="card-image">
                <img src="https://images.pexels.com/photos/1149831/pexels-photo-1149831.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940" />
              </div>

              <div class="card-heading">Audi Q8</div>
              <div class="card-text"></div>
              <div class="card-text">$67,400</div>
              <a href="#" class="card-button">
                Upadate
              </a>
              <a href="#" class="card-button">
                Delete
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Allcar;
